import { useState, useEffect } from "react";

function App() {
  const [user, setUser] = useState([]);

  useEffect(() => {
    fetch("/api/getUsers").then((res) => {
      setUser(res.data);
      console.log(user);
    });
  });

  return <div className="App"></div>;
}

export default App;
